// src/pages/IntroPage.js
import React from 'react';
import HistogramChart from '../components/HistogramChart';
import { firstDataset, secondDataset, thirdDataset } from '../data/datasets';

const IntroPage = () => {
  return (
    <div style={{ padding: '1rem' }}>
      <h1>Maximal Clique Enumeration</h1>
      <p>
        Maximal clique enumeration is a fundamental problem in graph theory with applications in social network analysis,
        bioinformatics, and recommendation systems. Identifying maximal cliques helps in understanding network structures,
        community detection, and various optimization problems. 
      </p>

      {/* You can continue with your existing Intro content here */}

      <h2>Clique Distribution Histograms</h2>
      <p>
        Below are three different datasets illustrating how clique sizes might be distributed in different graphs.
      </p>

      <HistogramChart
        data={firstDataset}
        title="Clique Size Distribution (Dataset 1)"
        color="#4f81bd"
      />

      <HistogramChart
        data={secondDataset}
        title="Clique Size Distribution (Dataset 2)"
        color="#c0504d"
      />

      <HistogramChart
        data={thirdDataset}
        title="Clique Size Distribution (Dataset 3)"
        color="#9bbb59"
      />

      {/* You could also add Time Analysis Histograms or other sections below */}
    </div>
  );
};

export default IntroPage;
